                     {'\n'}
                     available. 
                   </span>
                   <div className='card-read'>read</div>
                   <img src="https://www.bitgab.com/uploads/1597796080-pikachu-1597796080.png" alt='image'className='card-media'></img>
                   <span className='card-tag subtle'>Order Now</span>
            </div>
        </div>
     </div>

    </div>
  );
};

export default restaurant;
